r world surrounding the island abounds with marine fauna of every description. Hardly any other destination is as well-known for its countless large fish varieties, especially hammerhead, reef and offshore sharks. The film‘s author submerged to depths up to 400 meters on board the „Deep Sea“, a modern research submarine. During the dive, he ucceeded in shooting material of rare deep sea fish and shark species, which have never before been sighted near Coconut Island.\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/CmtH3nIlELc\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLCrAkY7naIDrYSgWbypLgP4K5zO_Q\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/CmtH3nIlELc\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLCiacl9ThvR20Pk3bBCU9ShvTsOkw\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/CmtH3nIlELc\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLB4TVo2gQJVTVOVoVXP-EYa7aMtow\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/CmtH3nIlELc\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLCtzyvd1wfyu8SHEIxkz-Y6sdhbcw\",\"width\":336,\"height\":188},{\"url\":\"https:\/\/i.ytimg.com\/vi\/CmtH3nIlELc\/maxresdefault.jpg\",\"width\":1920,\"height\":1080}]},\"averageRating\":4.7639661,\"allowRatings\":true,\"viewCount\":\"2517499\",\"author\":\"Free High-Quality Documentaries\",\"isPrivate\":false,\"isUnpluggedCorpus\":false,\"isLiveContent\":false},\"annotations\":[{\"playerAnnotationsExpandedRenderer\":{\"featuredChannel\":{\"startTimeMs\":\"5000\",\"endTimeMs\":\"2596000\",\"watermark\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/an\/_g32e3JeECjEuRbk-loywg\/featured_channel.jpg?v=59255114\",\"width\":40,\"height\":39}]},\"trackingParams\":\"CAQQ8zciEwjK76G4paDpAhVaHAYAHXf2CGM=\",\"navigationEndpoint , the English author Robert Louis Stevenson is said to have received the inspiration for his novel „Treasure Island“ here. \n\nThe tiny island comprises just 25 sqm² and is covered by an impenetrable jungle. Numerous streams, waterfalls and gorges epitomise the world‘s largest uninhabited rain forest island. Due to its isolation, unique flora and fauna have developed here. Today, as a national park and world natural heritage, the island is closely supervised by park rangers. \n\nThe outstanding underwater world surrounding the island abounds with marine fauna of every description. Hardly any other destination is as well-known for its countless large fish varieties, especially hammerhead, reef and offshore sharks. The film‘s author submerged to depths up to 400 meters on board the „Deep Sea“, a modern research submarine. During the dive, he ucceeded in shooting material of rare deep sea fish and shark species, which have never before been sighted near Coconut Island."}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CJEBEJsrIhMIzYOiuKWg6QIVRqzVCh1lywgC","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAndButtonRenderer":{"title":{"simpleText":"Want to subscribe to this channel?"},"content":{"simpleText":"Sign in to subscribe to this channel."},"button":{"buttonRenderer":{"style":"STYLE_BLUE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Sign in"},"navigationEndpoint":{"clickTrackingParams":"CJIBEP2GBCITCM2DoriloOkCFUas1QodZcsIAjIJc3Vic2NyaWJl","commandMetadata":{"webCommandMetadata":{"url":"https://accounts.google.com/ServiceLogin?service=youtube\u0026uilel=3\u0026passive=true\u0026continue=https%3A%2F%2Fwww.youtube.com%2Fsignin%3Faction_handle_signin%3Dtrue%26app%3Ddesktop%26hl%3Den%26next%3D%252Fwatch%253Fv%253DCmtH3nIlELc%26continue_action%3DQ
